  false,\n\t\"url\": null,\n\t\"notes\": \"The data set consists of basic water column
  properties of the Beaufort Sea and the Chukchi Sea near Barrow, Alaska. The environmental
  properties include salinity, temperature, chlorophyll a, major plant nutrients,
  and ice and snow cover. The microbial data included the abundance of various microbial
  groups, leucine incorporation, and the abundance of genes for 16S rRNA and ammonia
  monooxygenase (amoA). The data were collected in summer 2007, winter and summer
  2008, and winter 2009.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
